import react from 'react';

function WhenPaused({isTimerRunning}){
    if(isTimerRunning){
        return null;
    }else{
        <div className="row mb-2 d-block" id="paused">
            <div>
                <h3>PAUSED</h3>
            </div>
        </div>
    }
}

export default WhenPaused;
